- input: "TEXT\x1CC00041269\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's letter dated December 24, 2008.  The totals for Line 11(a)(iii)
    for Column B have been corrected.  The MEMO Schedule A for Roy E Barnes, Jim O
    Llewellyn, and Keith W Mason has been removed to reflect the correct year-to-date
    totals. The contributions from Donna Curling and Anne Weltner were attributed
    to the Runoff and thus no refund was required. The contribution from SEIU COPE
    was shown as a debt to the Non-Federal Account on this report and was transferred
    on a subsequent report. The Committee for Change Joint Fundraising Committee was
    incorrectly disclosed as the Battleground Victory JFC.  This has been corrected.
    The FEC ID numbers on Schedule A for Line 11(c) have been corrected. The payments
    for 'Postage' on Schedule B for Line 21(b) were for general ongiong postage refills
    for the Committee and were not for the benefit of any candidate for federal office.
    \ Payments classified as 'Exempt' on Schedule B for Line 30(b) do meet the definition
    of exempt activity as detailed in the Campaign Guide. No transfers-in from National
    Party Committees, including the Democratic National Committee and Democratic Senatorial
    Committee were used in paying for these exempt activities. The payment for 'Exempt
    Campaign Materials - Martin for Senate' were for exempt literature prepared by
    the Committee.  The payment for 'Sound Equipment for WFO Rally' was for general
    GOTV Rally Equipment expenses."
